metaData.author     = {'Bass Dye'};
metaData.date_subm  = [2021 5 12];
metaData.email      = {'bass.dye@nioz.nl '};
metaData.address    = {'NIOZ Royal Netherlands Institute for Sea Research'};

metaData.curator    = {'Starrlight Augustine'};
metaData.email_cur  = {'starrlight.augustine@akvaplan.niva.no'};
metaData.date_acc   = [2021 5 12];

%% set zero-variate data
