  temp.tp = C2K(13); units.temp.tp = 'K'; label.temp.tp = 'temperature';
data.am = 1460; units.am = 'd'; label.am = 'life span'; bibkey.am = {'Smie1992'};
  temp.am = C2K(13); units.temp.am = 'K'; label.temp.am = 'temperature';
  comment.am = 'CoheInad1990 - 3 years (1095 days)';

data.Lp = 14; units.Lp = 'cm'; label.Lp = 'length at puberty'; bibkey.Lp = {'CoheInad1990'};
  comment.Lp = 'Smie1992 - 13.4-16.0; BadsSain1978 - 14.2-18.3 (unsexed)';
data.Lpm = 12; units.Lpm = 'cm'; label.Lpm = 'length at puberty for males'; bibkey.Lpm = {'CoheInad1990'};
  comment.Lpm = 'CoheInad1990 - 11-13; Smiet1992 - 14.9';
data.Li = 25; units.Li = 'cm'; label.Li = 'ultimate length'; bibkey.Li = {'CoheInad1990'};

data.Ri = 82.19; units.Ri = '#/d'; label.Ri = 'ultimate reproduction rate'; bibkey.Ri = {'CoheInad1990'};
  temp.Ri = C2K(12); units.temp.Ri = 'K'; label.temp.Ri = 'temperature';
  comment.Ri = '30000 eggs in 1 reprod. cyce divided by 365 days; 9,000-30,000 eggs per female per year';

%% set uni-variate data
% length - wet weight
