  18.619 42.4569
  19.7619 51.0802
  20.9048 60.8193
  22.0476 71.7455
  23.1905 83.9308];
units.LWw = {'cm', 'g'}; label.LWw = {'length', 'wet weight'};
bibkey.LWw = {'BadsSain1978'};
comment.LWw = 'unsexed';

% time - length
data.tL_m = [ ... 
  365 11.2
  730 13.5
  1095 17.8];
units.tL_m = {'d', 'cm'}; label.tL_m = {'time', 'length'};
temp.tL_m = C2K(13); units.temp.tL_m = 'K'; label.temp.tL_m = 'temperature';
