bibkey.tL_f = {'Smie1992'};
comment.tL_f = 'Table 2';

%% set weights for all real data
weights = setweights(data, []);

%% set pseudodata and respective weights
[data, units, label, weights] = addpseudodata(data, units, label, weights);

%% pack auxData and txtData for output
auxData.temp = temp;
txtData.units = units;
txtData.label = label;
txtData.bibkey = bibkey;
txtData.comment = comment;

%% Discussion points
D1  = 'Typical body temp in *C (T_typical dig) was chosen to be 13*C based on ongoing Ciliata mustela experimental tempeature preference work by Bass Dye';
metaData.bibkey.D1 = 'D1';
D2  = 'am (life span) 0-variate data chosen to be 4 years (1460 days) because Smie1992 found 1 fish at 4 years old. CoheInad1990 said max age 3 years (1065 days)';
metaData.bibkey.D2 = 'D2';
D3  = 'Lpn and Lp uses values from CoheInad1990 although other values available from Smie1992 and BadsSain1978';
metaData.bibkey.D3 = 'D3';
metaData.discussion = struct('D1',D1, 'D2',D2, 'D3',D3);

%% Links
metaData.links.id_CoL = 'VBRH'; % Cat of Life
